import React from "react";
import axios from "axios";
import Nav from "../komponen/Nav";
import {  useForm, SubmitHandler } from "react-hook-form";
import Endpoint from "../config/Endpoint";

export default function  AddJenisProduk() {

    const { register, handleSubmit, watch, formState: { errors } } = useForm();
    const onSubmit = data => {
        axios.post(Endpoint.BASE_URL + `jenis_produk`,  data )
            .then(res => {
                if (res.data.error == false){
                    console.log(res.data.hasil.email);
                    console.log(res.data.hasil.id);
                    console.log(res.data.hasil.nama);

                    localStorage.setItem(Konstan.EMAIL, res.data.hasil.email);
                    localStorage.setItem(Konstan.ID, res.data.hasil.id);
                    localStorage.setItem(Konstan.NAMA, res.data.hasil.nama);
                }
            })
    };

    return(
        <div>
            <Nav/>
            <div className="container">
                <div className="container-fluid">

                    <h2>Tambah Jenis Produk</h2>

                </div>
            </div>
        </div>
    )
}
